import React, { useState, Fragment } from "react";
import { Link } from "react-router-dom";
import { useSelector } from "react-redux";

import { OrderForm } from "../cmps/OrderForm.jsx";

import Button from "@material-ui/core/Button";


export function Order() {
  const { mediaType, mediaLink, orderDetails } = useSelector(
    (state) => state.mediaModule
  );

  const initialUserDetails = {
    type: mediaType,
    link: mediaLink,
    order: orderDetails,
  };
  const [userDetails, setUserDetails] = useState(initialUserDetails);

  return (
    <Fragment>
      <h2>Order page</h2>
      <div>
        <h3>פרטי ההזמנה</h3>
        <h4>{userDetails.type} :סוג</h4>
        <h4>{userDetails.link} :לינק</h4>
      </div>
      <OrderForm></OrderForm>
      <Button variant="contained" color="default" disableElevation>
      <Link to="/completeorder"> 〱 רכוש עכשיו</Link>
      </Button>
      //לשלוח את המידע לדאטה בייס לשמור במערך הזמנות ובו זמנית לעבור לעמוד תשלום
    </Fragment>
  );
}
